                    </tr>
                </table>
            </div>
            <div class="resultadosGrupos">
                <a class="titulo">Simulação das Rodadas</a>
                <table class="rodadasGrupo">
                    <thead>
                        <th></th>
                        <th colSpan={3}>Rodada 1</th>
                        <th colSpan={3}>Rodada 2</th>
                        <th colSpan={3}>Rodada 3</th>
                    </thead>
                    <tbody>
                        <tr>
                            <td rowSpan={2}>
                                <strong>Grupo A</strong>
                            </td>
